import React from 'react'
import { StepNavDiv, OneThirdDiv } from './step-lower-nav.styles'
import StepListContainer from '../steps-list/steps-list.container';

export default function StepLowerNav({steps}) {
    return (
    <>
        <StepNavDiv>
            <OneThirdDiv active={true}>
                STEPS
            </OneThirdDiv>
            <OneThirdDiv>
                INFO
            </OneThirdDiv>
            <OneThirdDiv>
                LOG
            </OneThirdDiv>
        </StepNavDiv>
        {

        }
    </>
    )
}
